[{"location":"reference/#Reference","page":"Reference","title":"Reference","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"​","category":"page"},{"location":"reference/#Contents","page":"Reference","title":"Contents","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"​","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"Pages = [\"reference.md\"]","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"​","category":"page"},{"location":"reference/#Index","page":"Reference","title":"Index","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"​","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"Pages = [\"reference.md\"]","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"​","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"Modules = [QuadraticModels]","category":"page"},{"location":"reference/#QuadraticModels.QuadraticModel","page":"Reference","title":"QuadraticModels.QuadraticModel","text":"qp = QuadraticModel(c, Hrows, Hcols, Hvals; Arows = Arows, Acols = Acols, Avals = Avals, \n                    lcon = lcon, ucon = ucon, lvar = lvar, uvar = uvar)\n\nqp = QuadraticModel(c, H; A = A, lcon = lcon, ucon = ucon, lvar = lvar, uvar = uvar)\n\nCreate a Quadratic model min tfrac12 x^T Q x + c^T x + c_0 with optional bounds lvar ≦ x ≦ uvar and optional linear constraints lcon ≦ Ax ≦ ucon.\n\nYou can also use QPSReader.jl to create a Quadratic model from a QPS file:\n\nusing QPSReader\nqps = readqps(\"QAFIRO.SIF\")\nqp = QuadraticModel(qps)\n\n\n\n\n\n","category":"type"},{"location":"reference/#QuadraticModels.QuadraticModel-Union{Tuple{S}, Tuple{T}, Tuple{NLPModels.AbstractNLPModel{T, S}, AbstractVector{T} where T}} where {T, S}","page":"Reference","title":"QuadraticModels.QuadraticModel","text":"QuadraticModel(nlp, x)\n\nCreates a quadratic Taylor model of nlp around x.\n\n\n\n\n\n","category":"method"},{"location":"reference/#QuadraticModels.postsolve!-Union{Tuple{S}, Tuple{T}, Tuple{QuadraticModel{T, S}, QuadraticModels.PresolvedQuadraticModel{T, S}, S, S}} where {T, S}","page":"Reference","title":"QuadraticModels.postsolve!","text":"postsolve!(qm::QuadraticModel{T, S}, psqm::PresolvedQuadraticModel{T, S}, \n           x_in::S, x_out::S) where {T, S}\n\nRetrieve the solution x_out of the original QP qm given the solution of the presolved QP (psqm) x_in.\n\n\n\n\n\n","category":"method"},{"location":"reference/#QuadraticModels.presolve-Union{Tuple{QuadraticModel{T, S}}, Tuple{S}, Tuple{T}} where {T<:Real, S}","page":"Reference","title":"QuadraticModels.presolve","text":"psqm = presolve(qm::QuadraticModel{T, S}; kwargs...)\n\nApply a presolve routine to qm and returns a PresolvedQuadraticModel{T, S} <: AbstractQuadraticModel{T, S}. The presolve operations currently implemented are:\n\nremove_ifix!\n\n\n\n\n\n","category":"method"},{"location":"reference/#QuadraticModels.remove_ifix!-Union{Tuple{T}, Tuple{Any, Any, Any, Any, Any, Any, Any, Any, AbstractVector{T}, Any, Any, Any, Any, Any}} where T","page":"Reference","title":"QuadraticModels.remove_ifix!","text":"xrm, c0ps, nvarrm = remove_ifix!(ifix, Hrows, Hcols, Hvals, nvar, \n                                 Arows, Acols, Avals, c, c0, \n                                 lvar, uvar, lcon, ucon)\n\nRemove rows and columns in H, columns in A, and elements in lcon and ucon corresponding to fixed variables, that are in ifix (They should be the indices i where lvar[i] == uvar[i]).\n\nReturns the removed elements of lvar (or uvar), the constant term in the QP objective c0ps resulting from the fixed variables, and the new number of variables nvarrm. Hrows, Hcols, Hvals, Arows, Acols, Avals, c, lvar, uvar, lcon and ucon are updated in-place.\n\n\n\n\n\n","category":"method"},{"location":"#QuadraticModels.jl","page":"Home","title":"QuadraticModels.jl","text":"","category":"section"},{"location":"tutorial/#QuadraticModels.jl-Tutorial","page":"Tutorial","title":"QuadraticModels.jl Tutorial","text":"","category":"section"}]
